  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0103995 includes chemical,
  physical and underway data collected aboard the HEALY during cruise HLY11TC in the
  Bering Sea and North Pacific Ocean from 2011-06-12 to 2011-06-22. These data include
  CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V), DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, SALINITY, WATER TEMPERATURE and surface irradiance. The instruments used
  to collect these data include ADCP, CTD, GPS, PAR Sensor, echo sounder and oxygen
  meter. These data were collected by United States Coast Guard as part of Transit/Multibeam
  Testing. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
  as part of the NSF sponsored Rolling Deck to Repository (R2R) program. The CTD data
  submitted by the originator represent the raw data suite. Processed versions of
  the data were generated by NODC. The ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"license_title\":
